    "contracts/v5/ERC721MarketPlaceV5.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "../v3/ERC721MarketPlaceV3.sol";

contract ERC721MarketPlaceV5 is ERC721MarketPlaceV3 {
    uint256[] internal _defaultOwnerTokenGroups;
    address[] internal _defaultOwners;

    constructor(
        string memory name,
        string memory symbol,
        string memory baseURI,
        uint256 maxSupply_,
        uint256 mintPrice_,
        uint256 royalties_,
        address beneficiary_,
        address settlementToken_,
        uint256[] memory defaultOwnerTokenGroups_,
        address[] memory defaultOwners_
    )
        ERC721MarketPlaceV3(
            name,
            symbol,
            baseURI,
            maxSupply_,
            mintPrice_,
            royalties_,
            beneficiary_,
            settlementToken_,
            beneficiary_
        )
    {
        require(
            defaultOwners_.length == defaultOwnerTokenGroups_.length,
            "ERC721MarketPlaceV4: The length defaultOwners has to match the defaultOwnerTokenGroups"
        );

        _defaultOwnerTokenGroups = defaultOwnerTokenGroups_;
        _defaultOwners = defaultOwners_;

        uint256 lastTokenId = 0;
        uint256 defaultOwnersLen = _defaultOwners.length;
        for (uint256 i = 0; i < defaultOwnersLen; ++i) {
            uint256 groupEndTokenId = _defaultOwnerTokenGroups[i];
            _balances[_defaultOwners[i]] = groupEndTokenId - lastTokenId;
            lastTokenId = groupEndTokenId;
        }
        require(
            maxSupply_ - lastTokenId == 0,
            "ERC721MarketPlaceV4: All Tokens should be assigned to an Owner Group"
        );
    }

    function _exists(uint256 tokenId)
        internal
        view
        virtual
        override
        returns (bool)
    {
        return tokenId > 0 && tokenId <= maxSupply();
    }

    function ownerOf(uint256 tokenId)
        public
        view
        virtual
        override
        returns (address)
    {
        address owner = readOwnerOf(tokenId);
        if (_exists(tokenId) && owner == address(0)) {
            owner = _defaultOwnerOf(tokenId);
        }

        require(owner != address(0), "ERC721: invalid token ID");
        return owner;
    }

    function _defaultOwnerOf(uint256 tokenId)
        internal
        view
        virtual
        returns (address)
    {
        uint256 defaultOwnersLen = _defaultOwners.length;
        for (uint256 i = 0; i < defaultOwnersLen; ++i) {
            if (_defaultOwnerTokenGroups[i] >= tokenId) {
                return _defaultOwners[i];
            }
        }

        return _defaultOwner();
    }
}
