pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Strings.sol";
import "hardhat/console.sol";
import "../v2/ERC721MarketPlaceV2.sol";
import "./AbstractMarketPlacePermitV1.sol";

contract ERC721MarketPlaceV3 is
    ERC721MarketPlaceV2,
    AbstractMarketPlacePermitV1
{
    address private immutable _defaultOwnerAddress;

    constructor(
        string memory name,
        string memory symbol,
        string memory baseURI,
        uint256 maxSupply_,
        uint256 mintPrice_,
        uint256 royalties_,
        address beneficiary_,
        address settlementToken_,
        address defaultOwner_
    )
        ERC721MarketPlaceV2(
            name,
            symbol,
            baseURI,
            maxSupply_,
            mintPrice_,
            royalties_,
            beneficiary_,
            settlementToken_
        )
    {
        _defaultOwnerAddress = defaultOwner_;
        _totalSupply = maxSupply_;
        _setDefaultOwnerBalance();
    }

    function _exists(uint256 tokenId)
        internal
        view
        virtual
        override
        returns (bool)
    {
        return tokenId <= maxSupply();
    }

    function _defaultOwner() internal view virtual override returns (address) {
        return _defaultOwnerAddress;
    }

    function cancelAuthorization(
        bytes32 nonce,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public virtual {
        _cancelAuthorization(msg.sender, nonce, v, r, s);
    }

    function transferFromWithAuthorization(
        address from,
        address to,
        uint256 tokenId,
        uint256 validAfter,
        uint256 validBefore,
        bytes32 nonce,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public virtual {
        requireTransferAuthorization(
            from,
            to,
            tokenId,
            validAfter,
            validBefore,
            nonce,
            v,
            r,
            s
        );

        _safeTransfer(from, to, tokenId, "");
    }

    function tokensOfOwner(address _owner)
        external
        view
        returns (uint256[] memory result)
    {
        uint256 tokenCount = balanceOf(_owner);

        if (tokenCount == 0) {
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 totalTokens = totalSupply();
            uint256 resultIndex = 0;

            // We count on the fact that all cats have IDs starting at 1 and increasing
            // sequentially up to the totalTokens count.
            uint256 tokenId;

            for (tokenId = 1; tokenId <= totalTokens; tokenId++) {
                if (ownerOf(tokenId) == _owner) {
                    result[resultIndex] = tokenId;
                    resultIndex++;
                }
            }

            return result;
        }
    }
}
