pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/cryptography/draft-EIP712.sol";

abstract contract AbstractMarketPlacePermit is EIP712 {
    using Counters for Counters.Counter;

    mapping(address => Counters.Counter) private _nonces;

    // solhint-disable-next-line var-name-mixedcase
    bytes32 private constant _PERMIT_TYPEHASH =
        keccak256(
            "Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)"
        );

    // solhint-disable-next-line var-name-mixedcase
    bytes32 internal constant _NO_LONGER_FOR_SALE_PERMIT_TYPEHASH =
        keccak256(
            "TokenNoLongerForSalePermit(address owner,uint256 tokenId,uint256 nonce,uint256 deadline)"
        );

    // solhint-disable-next-line var-name-mixedcase
    bytes32 internal constant _OFFER_FOR_SALE_PERMIT_TYPEHASH =
        keccak256(
            "OfferTokenForSalePermit(address owner,uint256 tokenId,uint256 minSalePriceInWei,address toAddress,uint256 nonce,uint256 deadline)"
        );

    // solhint-disable-next-line var-name-mixedcase
    bytes32 internal constant _ACCEPT_TOKEN_BID_PERMIT_TYPEHASH =
        keccak256(
            "AcceptTokenBidPermit(address owner,uint256 tokenId,uint256 minPrice,uint256 nonce,uint256 deadline)"
        );

    // solhint-disable-next-line var-name-mixedcase
    bytes32 internal constant _WITHDRAW_TOKEN_BID_PERMIT_TYPEHASH =
        keccak256(
            "WithdrawTokenBidPermit(address owner,uint256 tokenId,uint256 nonce,uint256 deadline)"
        );

    /**
     * @dev Initializes the {EIP712} domain separator using the `name` parameter, and setting `version` to `"1"`.
     *
     * It's a good idea to use the same `name` that is defined as the ERC20 token name.
     */
    constructor(string memory name) EIP712(name, "1") {}

    function requirePermit(
        uint256 tokenId,
        address owner,
        address spender,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal virtual returns (bool) {
        require(
            block.timestamp <= deadline,
            "AbstractMarketPlacePermit: expired deadline"
        );

        bytes memory encodedStruct = abi.encode(
            _PERMIT_TYPEHASH,
            owner,
            spender,
            tokenId,
            _useNonce(owner),
            deadline
        );

        return _validateSig(encodedStruct, owner, v, r, s);
    }

    function requireTokenNoLongerForSalePermit(
        uint256 tokenId,
        address owner,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal virtual returns (bool) {
        require(
            block.timestamp <= deadline,
            "AbstractMarketPlacePermit: expired deadline"
        );

        bytes memory encodedStruct = abi.encode(
            _NO_LONGER_FOR_SALE_PERMIT_TYPEHASH,
            owner,
            tokenId,
            _useNonce(owner),
            deadline
        );

        return _validateSig(encodedStruct, owner, v, r, s);
    }

    function requireOfferTokenForSalePermit(
        uint256 tokenId,
        address owner,
        uint256 minSalePriceInWei,
        address toAddress,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal virtual returns (bool) {
        require(
            block.timestamp <= deadline,
            "AbstractMarketPlacePermit: expired deadline"
        );

        bytes memory encodedStruct = abi.encode(
            _OFFER_FOR_SALE_PERMIT_TYPEHASH,
            owner,
            tokenId,
            minSalePriceInWei,
            toAddress,
            _useNonce(owner),
            deadline
        );

        return _validateSig(encodedStruct, owner, v, r, s);
    }

    function requireAcceptTokenPermit(
        uint256 tokenId,
        address owner,
        uint256 minPrice,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal virtual returns (bool) {
        require(
            block.timestamp <= deadline,
            "AbstractMarketPlacePermit: expired deadline"
        );

        bytes memory encodedStruct = abi.encode(
            _ACCEPT_TOKEN_BID_PERMIT_TYPEHASH,
            owner,
            tokenId,
            minPrice,
            _useNonce(owner),
            deadline
        );

        return _validateSig(encodedStruct, owner, v, r, s);
    }

    function requireWithdrawTokenPermit(
        uint256 tokenId,
        address owner,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal virtual returns (bool) {
        require(
            block.timestamp <= deadline,
            "AbstractMarketPlacePermit: expired deadline"
        );

        bytes memory encodedStruct = abi.encode(
            _WITHDRAW_TOKEN_BID_PERMIT_TYPEHASH,
            owner,
            tokenId,
            _useNonce(owner),
            deadline
        );

        return _validateSig(encodedStruct, owner, v, r, s);
    }

    function _validateSig(
        bytes memory encodedStruct,
        address owner,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal virtual returns (bool) {
        bytes32 structHash = keccak256(encodedStruct);

        bytes32 hash = _hashTypedDataV4(structHash);

        address signer = ECDSA.recover(hash, v, r, s);
        require(
            signer == owner,
            "AbstractMarketPlacePermit: invalid signature"
        );

        return true;
    }

    /**
     * @dev Returns the current nonce for `owner`. This value must be
     * included whenever a signature is generated for {permit}.
     *
     * Every successful call to {permit} increases ``owner``'s nonce by one. This
     * prevents a signature from being used multiple times.
