        address buyer,
        uint256 tokenId,
        uint256 value,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal virtual {
        _requireExistingToken(tokenId);
        _requireNotTokenOwner(buyer, tokenId);

        Offer memory offer = offers[tokenId];
        require(offer.isForSale, "The token is not for sale");
        require(
            offer.onlySellTo == address(0) || offer.onlySellTo == buyer,
            "The token is not for sale to this caller"
        );
        require(
            value >= offer.minValue,
            "The caller did not allow enough Token"
        );
        require(
            offer.seller == ownerOf(tokenId),
            "The seller is no longer the owner of the token"
        );

        require(
            _receiveSettlementToken(buyer, value, deadline, v, r, s),
            "The buyer is unable to transfer the token"
