        uint256 amount = bid.value;
        bids[tokenId] = Bid(false, tokenId, address(0), 0);

        _safeTransfer(seller, bid.bidder, tokenId, "");

        _transferWithRoyalties(seller, amount);
        emit TokenBought(tokenId, bid.value, seller, bid.bidder);
    }

    function _withdrawTokenBid(address bidder, uint256 tokenId)
        internal
        virtual
    {
        _requireExistingToken(tokenId);
        _requireNotTokenOwner(bidder, tokenId);
        Bid memory bid = bids[tokenId];

        require(
            bid.bidder == bidder,
            "The caller as no active bid on this token!"
